import "./todo.css"
const Todo = () => {
  const inputEvent = () => {};
  const inputList = () => {};
  return (
    <>
      <div className="main_container">
        <div className="top_head">
            <div className="header">
            <h1>Today's Routine!</h1>
            </div>
          <div className="dayAndDate">
              <span className="day">Day of the week</span>
              <span className="date">date of the Month</span>

          </div>
        </div>
        <div className="input_feild">
        <input className="input_section"
          type="text"
          placeholder="Add a Task"
          onChange={inputEvent}
          value={inputList}
        />
        <button>+</button>
        </div>
        
      </div>
    </>
  );
};
export default Todo;
